window.bookSummaryJSON = "<p>Hundreds of thousands of copies sold. Lightning-paced supernatural action. Readers describe it as \"the most original supernatural series in ages\".</p> <p>Meet Justin Case.</p> <p>Atlanta is ground zero for a supernatural invasion. Enter Justin Case, a snarky nerd with all the sex appeal and heroic potential of a potato. That is until he comes into his demonic powers and finds out everybody hates demon spawn. The problem? He might be the last hope for uniting the Overworld and saving us all.</p> <p><i>Sweet Blood of Mine </i></p> <p>The origin story that started it all. Justin finds out there's a lot more to life than live-action role playing and a pursuit of nerdly adventures. Vampires, felycans, lycans, sorcerers, and Templars all exist. The problem is, Justin isn't one of them. He's something else. Something terrible. And the girl he falls in love with may be sworn to kill him.</p> <p><i>Dark Light of Mine </i></p> <p>Hellhounds and demon spawn are out for blood. Justin's father is marked for death.</p> <p>Justin and Elyssa have to track down the mysterious person behind it all before it's too late.</p> <p><i>Fallen Angel of Mine </i></p> <p>During an escape from the gray men, Justin and Elyssa are stranded in Thunder Rock with a notorious Daemas, Kassallandra. They find a way out, but Justin is separated, thrown through a broken Obsidian Arch, and ends up in Colombia where he'll face his greatest challenge yet.</p> <p>Meanwhile, Elyssa is captured by her father. He hates Daemos and hates Justin and wants to put her through a ritual that will erase all memories of Justin.</p> <p>Death can't stop true love, but a mind wipe probably will.</p> <p>The Overworld Chronicles series order:</p> <p></p> <ol> <li><i>Sweet Blood of Mine </i></li> <li><i>Dark Light of Mine </i></li> <li><i>Fallen Angel of Mine </i></li> <li><i>Dread Nemesis of Mine </i></li> <li><i>Twisted Sister of Mine </i></li> <li><i>Dearest Mother of Mine </i></li> <li><i>Infernal Father of Mine </i></li> <li><i>Sinister Seraphim of Mine </i></li> <li><i>Wicked War of Mine </i></li> <li><i>Dire Destiny of Ours</i></li> <li><i>Aetherial Annihilation </i></li> <li><i>Baleful Betrayal </i></li> <li><i>Ominous Odyssey </i></li> </ol>"; 
